svg.script:

	  function ShowData(pathClass,svgNodeID)
	  {
	  if(pathClass=="bear"){
		window.open('../../MonitorData.aspx?id='+svgNodeID);
	}else if(pathClass=="acceleration"){
		window.open('../../AccMonitorData.aspx?id='+svgNodeID);
	}else if(pathClass=="acceleration2"){
		window.open('../../DAccMonitorData.aspx?id='+svgNodeID);
	}else if(pathClass=="strain"){
		window.open('../../StreeMonitorData.aspx?id='+svgNodeID);
	}else if(pathClass=="wind"){
		window.open('../../WindRose.aspx?id='+svgNodeID);
	}else if(pathClass=="temp"){
		window.open('../../MonitorData.aspx?id='+svgNodeID);
	}else if(pathClass=="welds"){
		window.open('../../WeldMonitorData.aspx?id='+svgNodeID);
	}else if(pathClass=="displacement"){
		window.open('../../displacement.aspx?id='+svgNodeID);
	}else if(pathClass=="settlement"){
		window.open('../../settlement.aspx?id='+svgNodeID);
	}


  }
